import "./navbar.css"
import React from "react";
import InAppBanner from './images/InAppBanner.png';

const Navbar = () => {
    return (
        <div className="navbar">
        <img className="img" src={InAppBanner} alt="Black Lit App"></img>
        <ul className="list">
            <li className="listItem">
                <img src="" alt="" className="avatar" />
            </li>
            <li className="listItem">Dante Noir</li>
            <li className="listItem">Logout</li>
        </ul>
    </div>
    )
};

export default Navbar;
